For example, if a developer is tasked with creating an algorithm to sort a list of numbers, they might use a language like C++ and create a function like this: void sort(int arr[], int n) { 
 for (int i = 0; i < n; i++) 
 for (int j = 0; j < n-i-1; j++) 
 if (arr[j] > arr[j+1]) 
 swap(&arr[j], &arr[j+1]); 
 } 

This is a simple example of a bubble sort algorithm, which is used to sort a list of numbers in ascending order.

