public int binarySearch(int array[], int x) {
  int l = 0, r = array.length - 1;
  while (l <= r) {
    int m = l + (r - l) / 2;
    if (array[m] == x) return m;
    if (array[m] < x) l = m + 1;
    else r = m - 1;
  }
  return -1;
}

